import '../Styles/index_Logements_icons.css'
import Logements from '../logements.json'

function LocationsIcons (){
    console.log(Logements)
    return (
        <div className='Background_icons'>
                {Logements.map((pictures) => {
                return (
                        <div key={pictures.id}>
                            <span className='Title'>{pictures.title}</span>
                            <img key={pictures.url} src={pictures}alt="Photos" className='Icons'/>
                        </div>
                    )
                })}
            </div>
    )
}
